layers.shader:
#uicontrol int roi_id slider(min=0, max=86, step=1, default=1)

void main() {
    vec3 roi_color = vec3(prop_roi_color());
    if (int(prop_roi()) != roi_id) {
       discard;
  }
    setLineColor(defaultColor());
    setEndpointMarkerSize(8.0, 8.0);
    setEndpointMarkerColor(roi_color, roi_color);
    setEndpointMarkerBorderWidth(1.0, 1.0);
    setEndpointMarkerBorderColor(vec3(0,0,0), vec3(0,0,0));
}
